var DataTablesController=function(){var n=function(n,t){$(`#${n}`).DataTable(t)},t=function(n){return n.rows(".selected").data().map(n=>n)},i=function(n){$(`#${n}`).DataTable().ajax.reload()},r=function(){return $.fn.dataTable.render.number()},u=function(){return $.fn.dataTable.render.text()};return{initialize:n,getSelectedRows:t,reloadTable:i,renderAsNumber:r,renderAsText:u}}();